def mostCompetitive(nums: [int], k: int) -> [int]:
    n = len(nums)
    count = 0
    res = list()
    num = nums[:n - k + 1]
    while count < k:
        temp = min(num)
        ind = num.index(temp)
        res.append(temp)
        count += 1
        num = num[ind + 1:] + [nums[-k + count]]
    return res

